<?php

namespace SkinFix\skin;
use pocketmine\entity\Skin;
use pocketmine\network\mcpe\protocol\types\LegacySkinAdapter;
use pocketmine\network\mcpe\protocol\types\SkinData;


/**
 * Class SkinAdapterPersona
 * @package Core\Core\network\mcpe\protocol\types
 * @author Florian H.
 * @date 24.07.2020 - 16:14
 * @project Core
 */
class SkinAdapterPersona extends LegacySkinAdapter {
	/**
	 * Function fromSkinData
	 * @param SkinData $data
	 * @return Skin
	 */
	public function fromSkinData(SkinData $data): Skin{
		if ($data->isPersona()) {
			return new Skin(
				"Florian",
				""
			);
		}
		return parent::fromSkinData($data);
	}
}
